var rnd_x = 123;
function prng(max) {
    rnd_x = (rnd_x * 16807) % 0x7fffffff;
    return rnd_x % max;
}

function rndString(maxLen) {
    var len = prng(maxLen);
    var i;
    var res = '';

    for (i = 0; i < len; i++) {
        res += String.fromCharCode(0x41 + prng(26));
    }

    return res;
}

function randomStringsTest() {
    var arr = [];
    var i;
    var str1, str2;

    for (i = 0; i < 10000; i++) {
        arr.push(rndString(8));
    }

    print(arr);

    arr.sort();
    str1 = arr.toString();
    print(str1);

    arr.sort();
    str2 = arr.toString();
    print(str1 === str2);
}

randomStringsTest();

